   public void testSubtractMathContext001() {
    bigDec= new BigDecimal("0");  
    BigDecimal bigDec2= new BigDecimal("0");  
 assertEquals(msgNotSame,new BigDecimal("0"),bigDec.subtract(bigDec2,new MathContext(0,RoundingMode.UP)));
}
    
